import React from "react";

function Card(props) {
  return (
    <section className="card-section">
      <div className="card">
        <div className="title-card">
          <h2>{props.name}</h2>
        </div>
        <img src={props.img} alt="" />
        <div class="card-body">
          <p></p>
        </div>
      </div>
    </section>
  );
}

export default Card;
